import './App.css';
import React from "react";
import {Routes, Route} from 'react-router-dom'
import Recipe from "./components/Recipe";
import Header from "./components/Header";




function App(){
    return (
        <div className='App'>
            <Routes>
                <Route path='/' element={
                    <Header/>
                } />
                <Route path='/recipes/' element={
                    <Recipe/>
                } />
            </Routes>
        </div>
    );
}


export default App;
